        source: () => this._disabled(),
        computation: v => v
    })

computed(() => {
        const selectMode = this.selectMode()
        return (
            selectMode === 'range' ||
            selectMode === 'rangeFrom' ||
            selectMode === 'rangeTo'
        )
    })

linkedSignal({
        source: () => this.startView(),
        computation: v => v
    })

computed(() => {
        const selectMode = this.selectMode()
        return (
            selectMode === 'range' ||
            selectMode === 'rangeFrom' ||
            selectMode === 'rangeTo'
        )
    })

computed(() => {
        const currentView = this.currentView()
        if (currentView === 'month') {
            return this.pickerIntl.nextMonthLabel()
        } else if (currentView === 'year') {
            return this.pickerIntl.nextYearLabel()
        }
        return
    })

computed(() => {
        const value = this.dateTimeAdapter.deserialize(this._pickerMoment())
        return this.getValidDate(value) || this.dateTimeAdapter.now()
    })

computed(() => {
        const currentView = this.currentView()
        if (currentView === 'month') {
            return this.pickerIntl.prevMonthLabel()
        } else if (currentView === 'year') {
            return this.pickerIntl.prevYearLabel()
        }
        return
    })

linkedSignal({
        source: () => this._disabled(),
        computation: value => value ?? !!this.dtInput()?.disabled()
    })

computed(() => {
        // If an explicit startAt is set we start there, otherwise we start at whatever the currently
        // selected value is.
        const startAt = this._startAt()
        if (startAt) {
            return startAt
        }

        const dtInput = this.dtInput()
        if (dtInput) {
            if (dtInput.selectMode() === 'single') {
                return dtInput.value()
            } else if (
                dtInput.selectMode() === 'range' ||
                dtInput.selectMode() === 'rangeFrom'
            ) {
                return dtInput.values()[0]
            } else if (dtInput.selectMode() === 'rangeTo') {
                return dtInput.values()[1]
            }
        }
        return
    })

linkedSignal({
        source: () => this._disabled(),
        computation: v => v
    })

linkedSignal({
        source: () => this.value(),
        computation: v => v
    })

linkedSignal({
        source: () => this.values(),
        computation: v => v || []
    })

computed(() => {
        const startAt = this._startAt()
        if (startAt) {
            return startAt
        }

        const selectMode = this.selectMode()

        if (selectMode === 'single') {
            return this.value()
        } else if (
            selectMode === 'range' ||
            selectMode === 'rangeFrom'
        ) {
            return this.values()?.[0]
        } else if (selectMode === 'rangeTo') {
            return this.values()?.[1]
        } else {
            return
        }
    })

computed(() => {
        let value = this._value()
        value = this.dateTimeAdapter.deserialize(value)
        value = this.getValidDate(value)
        return value
    })

computed(() => {
        let values = this._values()
        if (values && values.length > 0) {
            values = values.map(v => {
                v = this.dateTimeAdapter.deserialize(v)
                v = this.getValidDate(v)
                return (v && this.dateTimeAdapter.clone(v))
            })
            return [...values]
        } else {
            return []
        }
    })

computed(() => {
        if (!this.pickerMoment()) {
            return
        }

        let todayDate: number | undefined

        // the first weekday of the month
        const startWeekdayOfMonth = this.dateTimeAdapter.getDay(
            this.firstDateOfMonth()
        )
        const firstDayOfWeek = this.firstDayOfWeek()

        // the amount of days from the first date of the month
        // if it is < 0, it means the date is in previous month
        let daysDiff =
            0 -
            ((startWeekdayOfMonth + (DAYS_PER_WEEK - firstDayOfWeek)) %
                DAYS_PER_WEEK)

        // the index of cell that contains the first date of the month
        const firstRowOffset = Math.abs(daysDiff)

        const days: CalendarCell[][] = []
        for (let i = 0; i < WEEKS_PER_VIEW; i++) {
            const week = []
            for (let j = 0; j < DAYS_PER_WEEK; j++) {
                const date = this.dateTimeAdapter.addCalendarDays(
                    this.firstDateOfMonth(),
                    daysDiff
                )
                const dateCell = this.createDateCell(date, daysDiff)

                // check if the date is today
                if (
                    this.dateTimeAdapter.isSameDay(
                        this.dateTimeAdapter.now(),
                        date
                    )
                ) {
                    todayDate = daysDiff + 1
                }

                week.push(dateCell)
                daysDiff += 1
            }
            days.push(week)
        }
        return {
            days,
            todayDate,
            firstRowOffset
        }
    })

computed(() => {
        const days = this._daysData()?.days
        if (days != undefined)
            return this._days = days
        return this._days
    })

computed(() => {
        const firstRowOffset = this._daysData()?.firstRowOffset
        if (firstRowOffset != undefined)
            return this._firstRowOffset = firstRowOffset
        return this._firstRowOffset
    })

computed(() => {
        /**
         * Set the selectedDates value.
         * In single mode, it has only one value which represent the selected date
         * In range mode, it would has two values, one for the fromValue and the other for the toValue
         */
        let selectedDates = new Array<number | undefined>()

        if (!this.firstDateOfMonth()) {
            return this._selectedDates
        }

        if (this.isInSingleMode() && this.selected()) {
            const dayDiff = this.dateTimeAdapter.differenceInCalendarDays(
                this.selected(),
                this.firstDateOfMonth()
            ) ?? 0
            selectedDates[0] = dayDiff + 1
            return this._selectedDates = selectedDates
        }

        if (this.isInRangeMode() && this.selecteds()) {
            selectedDates = this.selecteds().map(selected => {
                if (this.dateTimeAdapter.isValid(selected)) {
                    const dayDiff = this.dateTimeAdapter.differenceInCalendarDays(
                        selected,
                        this.firstDateOfMonth()
                    ) ?? 0
                    return dayDiff + 1
                }
                return
            })
        }
        return this._selectedDates = selectedDates
    })

computed(() => {
        const todayDate = this._daysData()?.todayDate
        if (todayDate != undefined)
            return this._todayDate = todayDate
        return this._todayDate
    })

computed(() => {
        const longWeekdays = this.dateTimeAdapter.getDayOfWeekNames('long')
        const shortWeekdays = this.dateTimeAdapter.getDayOfWeekNames('short')
        const narrowWeekdays = this.dateTimeAdapter.getDayOfWeekNames('narrow')
        const firstDayOfWeek = this.firstDayOfWeek()

        const weekdays = longWeekdays.map((long, i) => ({ long, short: shortWeekdays[i], narrow: narrowWeekdays[i] }))

        return weekdays
            .slice(firstDayOfWeek)
            .concat(weekdays.slice(0, firstDayOfWeek))
    })

computed(() => {
        const value = this.dateTimeAdapter.deserialize(this._pickerMoment())
        return this.getValidDate(value) || this.dateTimeAdapter.now()
    })

computed(() => {
        let selectedYears = new Array<number | undefined>()

        if (this.isInSingleMode() && this.selected()) {
            selectedYears[0] = this.dateTimeAdapter.getYear(this.selected())
        }

        if (this.isInRangeMode() && this.selecteds()) {
            selectedYears = this.selecteds().map((selected) => {
                if (this.dateTimeAdapter.isValid(selected)) {
                    return this.dateTimeAdapter.getYear(selected)
                }
                return
            })
        }
        return selectedYears
    })

computed(() => {
        const years = this.years()
        if (years && years.length > 0) {
            return `${years[0][0].displayValue} ~ ${years[YEAR_ROWS - 1][YEARS_PER_ROW - 1].displayValue}`
        }
        return
    })

computed(() => {
        const months = this.monthsData()?.months
        if (months != undefined)
            return this._months = months
        return this._months
    })

computed(() => {
        /**
         * Set the selectedMonths value
         * In single mode, it has only one value which represent the month the selected date in
         * In range mode, it would has two values, one for the month the fromValue in and the other for the month the toValue in
         */
        const selectedMonths: Array<number | undefined> = []
        if (this.isInSingleMode() && this.selected()) {
            selectedMonths[0] = this.getMonthInCurrentYear(this.selected())
        }

        if (this.isInRangeMode() && this.selecteds()) {
            selectedMonths[0] = this.getMonthInCurrentYear(
                this.selecteds()[0]
            )
            selectedMonths[1] = this.getMonthInCurrentYear(
                this.selecteds()[1]
            )
        }
        return selectedMonths
    })

computed(() => {
        const todayMonth = this.monthsData()?.todayMonth
        if (todayMonth != undefined)
            return this._todayMonth = todayMonth
        return this._todayMonth
    })
